    protected override async Task OnInitializedAsync()
    {
        thisUser = await prDataService.GetOneUserAsync(PrUserId);
        //thisUser = _UserManager.Users.FirstOrDefault(x => x.PrUserId == Id.ToString());
        if (thisUser.Email == null)
        {
            thisUser.Email = "";
        }
